			"text": "그래서 \"있다\"고 말할 때 서양은 \"is\"라는 문법을 생각하지만, 동양은 \"거기 있다\"는 공간의 양식을 생각하게 된다. 서양에서 있음은 논리적으로 있음이고, 동양은 (공간을 점유하면서) 존재적으로 있음이다. 이러한 둘 차이가 핵심적인 부분으로 보인다.",
